import { Container } from 'react-bootstrap';
const Mailinfo = (props) => {
    const id = props.id ;
    const body = props.body;

    return (<Container>
        <p>{id}</p>
        <br>
        </br>
        <p>{body}</p>

        <hr>
        </hr>
        <hr>
        </hr>
    </Container>)

};

export default Mailinfo;
